  \"the-status-of-metal-levels-in-common-loons-gavia-immer-in-the-northeast-united-states\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"From 1989-1993, 178 common loons found
  dead or moribund throughout the northeastern United States were examined by personnel
  from Tufts University School of Veterinary Medicine. Major findings include 46 deaths
  involving trauma, 19 deaths involving infection, 36 deaths involving ingested lead,
  14 deaths involving plastic entanglement, and 26 deaths involving aspergillosis.
  This report contains toxicological data (liver and kidney tissue analysis) from
  a subset of 34 individuals found that lead, mercury, aluminum, selenium, iron, and
  cadmium concentrations were elevated in the northeastern United States loon population.
  In adults, liver lead concentrations ranged from <0.06 to 31.09 parts per million
  (ppm), and liver mercury levels ranged from 0.989 to 100.483 ppm. Ingested lead
  (mostly fishing sinkers and jigs) was found in 60.0 % of the adult loons from freshwater
  lakes. In most cases lead ingestion was accompanied by elevated liver lead levels.
  It is believed that the loons who ingested lead objects died from acute lead toxicosis.
  Results of this study confirm that much of summer loon mortality is closely linked
  to anthropogenic activities on and near breeding lakes.\",\n\t\"license_title\":
